import {Component, OnInit} from '@angular/core';
import { AuthServiceService } from '../services/auth-service.service';
import {FormControl} from "@angular/forms";
import {map, Observable, startWith} from "rxjs";

declare function getRandomPhoto(): string;

@Component({
  selector: 'app-header',
  templateUrl: './header.component.html',
  styleUrls: ['./header.component.css'],
})


export class HeaderComponent  implements OnInit{

  provinceList = [
    { value: 'AG', label: 'Agrigento' },
    // Aggiungi altre opzioni qui
  ];

  ngOnInit(): void {
    this.populateDropdown();
  }

  populateDropdown(): void {
    const selectElement = document.querySelector('#accessibleAutocomplete');

    this.provinceList.forEach(province => {
      const option = document.createElement('option');
      option.value = province.value;
      option.textContent = province.label;
      // @ts-ignore
      selectElement.appendChild(option);
    });
  }





  constructor(private authService: AuthServiceService){}

  getRandomPhotoUrl(){
    console.log(getRandomPhoto());
    return getRandomPhoto();
  }

  isAuthenticated(){
    return this.authService.isAuthenticated();
  }
  doLogout(){
    console.log("click");
    this.authService.logout();
  }


}
